// src/App.js
import React, { useState } from "react";
import MainPage from "./Сomponents/mainPage/MainPage";
import RegistrationPage from "./Сomponents/registrationPage/RegistrationPage";
import PDFUploadPage from "./Сomponents/pdfUploadPage/PdfUploadPage";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./App.css";

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            isLoggedIn ? (
              <Routes>
                <Route path="/" element={<PDFUploadPage />} />
                <Route path="/unloading" element={<div>Unloading Page</div>} />
                <Route path="/admin" element={<div>Admin Page</div>} />
              </Routes>
            ) : (
              <MainPage onLogin={handleLogin} />
            )
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
